import React from "react";

function Chats(props) {
  return (
    <div className="chats">
      <div className="userChat">
        <img
          src="https://znews-photo.zingcdn.me/w860/Uploaded/lce_jwqqc/2020_08_04/70199967_2583206275034497_4446980168723988480_n_1.jpg"
          alt=""
        />
        <div className="userChatInfo">
          <span>Thuc</span>
          <p>Hello</p>
        </div>
      </div>
    </div>
  );
}

export default Chats;
